INSERT INTO `v1_f0bd82009756089dccebff514cf79ccb3204c6be05623840a2eeb8016be27834` VALUES (-416.5, 2, 190801, 1, "カリン", "2025/01/31 12:00:00", 0.0, 3.414, 1000001, "ミッションをクリアすると、\n報酬がもらえますよ！\n頑張ってください", "2030/01/01 14:59:59", 1, 62, 1);
INSERT INTO `v1_f0bd82009756089dccebff514cf79ccb3204c6be05623840a2eeb8016be27834` VALUES (-416.5, 2, 190801, 2, "カリン", "2025/01/31 12:00:00", 0.0, 3.099, 1000002, "ミッションをクリアして、\n報酬をゲットしましょう！", "2030/01/01 14:59:59", 1, 62, 1);
INSERT INTO `v1_f0bd82009756089dccebff514cf79ccb3204c6be05623840a2eeb8016be27834` VALUES (-416.5, 2, 190801, 3, "カリン", "2025/01/31 12:00:00", 0.0, 2.801, 1000003, "受け取ることができる\n報酬があるようです\n確認してみてください", "2030/01/01 14:59:59", 1, 63, 1);
INSERT INTO `v1_f0bd82009756089dccebff514cf79ccb3204c6be05623840a2eeb8016be27834` VALUES (-416.5, 2, 190801, 4, "カリン", "2025/01/31 12:00:00", 0.0, 0.0, 1000004, "報酬がもらえますよ！\nチェックしてみてください", "2030/01/01 14:59:59", 2, 63, 1);
INSERT INTO `v1_f0bd82009756089dccebff514cf79ccb3204c6be05623840a2eeb8016be27834` VALUES (-363.0, 1, 190801, 5, "カリン", "2025/01/31 12:00:00", 0.0, 2.12, 1000005, "ギルド管理協会です！\nイベント報酬券をお持ちでしたら、様々なアイテムと交換できますよ", "2030/01/01 14:59:59", 2, 64, 1);
INSERT INTO `v1_f0bd82009756089dccebff514cf79ccb3204c6be05623840a2eeb8016be27834` VALUES (-363.0, 2, 190801, 6, "カリン", "2025/01/31 12:00:00", 0.0, 1.68, 1000006, "お疲れさまです！\nこちらでイベント報酬券とアイテムを交換することができますよ", "2030/01/01 14:59:59", 1, 64, 1);
INSERT INTO `v1_f0bd82009756089dccebff514cf79ccb3204c6be05623840a2eeb8016be27834` VALUES (-363.0, 1, 190801, 7, "カリン", "2025/01/31 12:00:00", 0.0, 2.33, 1000007, "いつもありがとうございます！\n報酬交換ですか？\nでは、イベント報酬券とお引き換えいたしますね", "2030/01/01 14:59:59", 2, 64, 1);
INSERT INTO `v1_f0bd82009756089dccebff514cf79ccb3204c6be05623840a2eeb8016be27834` VALUES (-285.0, 7, 133701, 101, "ラビリスタ", "2025/01/31 12:00:00", -6.0, 5.18, 1020101, "今度の敵は、アタシにとっても\n放ってはおけない存在だ\n少年、アタシも全力で行くからさ\n一緒に守ろう、この世界を", "2030/01/01 14:59:59", 3, 61, 10201);
INSERT INTO `v1_f0bd82009756089dccebff514cf79ccb3204c6be05623840a2eeb8016be27834` VALUES (-285.0, 2, 133901, 201, "クリスティーナ", "2025/01/31 12:00:00", -2.0, 8.77, 1020102, "退屈の吹き飛ぶような\n戦いの気配がするなぁ坊や\nさっさとワタシをそこへ連れてゆけ\n世界も守ってやるさ、ついでにな", "2030/01/01 14:59:59", 1, 61, 10201);
INSERT INTO `v1_f0bd82009756089dccebff514cf79ccb3204c6be05623840a2eeb8016be27834` VALUES (-285.0, 1, 133801, 301, "ネネカ", "2025/01/31 12:00:00", 0.0, 15.5, 1020103, "おや、私の力が必要……と？\nグレゴールが手伝うそうですよ\n私は戦わないのか、という顔ですね\n……考えておきます", "2030/01/01 14:59:59", 6, 61, 10201);
INSERT INTO `v1_f0bd82009756089dccebff514cf79ccb3204c6be05623840a2eeb8016be27834` VALUES (-285.0, 5, 134301, 101, "ランファ", "2025/02/28 12:00:00", 0.0, 9.061, 1020201, "わたしだけの歌…\n一緒に、探してくれる…？\nあなたがいれば…\nもっとがんばれるから…", "2030/01/01 14:59:59", 2, 61, 10202);
INSERT INTO `v1_f0bd82009756089dccebff514cf79ccb3204c6be05623840a2eeb8016be27834` VALUES (-285.0, 2, 134401, 201, "チカ", "2025/02/28 12:00:00", 0.0, 7.699, 1020202, "同じ唱喚士として、仲間として\n私にできることをします\n…これも、あなたが\n背中を押してくれたおかげですよ", "2030/01/01 14:59:59", 1, 61, 10202);
INSERT INTO `v1_f0bd82009756089dccebff514cf79ccb3204c6be05623840a2eeb8016be27834` VALUES (-285.0, 2, 134601, 101, "アオイ", "2025/03/31 12:00:00", 0.0, 8.595, 1020301, "世界の平和が私とクローチェさんに\nかかってるんですよね？\nぼっちには過大すぎる期待ですけど\nふ、二人でなら背負ってみせます！", "2030/01/01 14:59:59", 1, 61, 10203);
INSERT INTO `v1_f0bd82009756089dccebff514cf79ccb3204c6be05623840a2eeb8016be27834` VALUES (-285.0, 2, 134501, 201, "クローチェ", "2025/03/31 12:00:00", 0.0, 7.758, 1020302, "新しく手に入れたこの翼で…\nナイトさんがどこにいたって\nわたし、駆けつけちゃいますよっ！\nクローチェ・エアリアル発進ですっ", "2030/01/01 14:59:59", 1, 61, 10203);
INSERT INTO `v1_f0bd82009756089dccebff514cf79ccb3204c6be05623840a2eeb8016be27834` VALUES (-285.0, 6, 132302, 101, "ルイズマリー", "2025/04/30 12:00:00", 0.0, 7.0, 1020401, "今日はダーリンとの初デート♪\n二人でショッピングして、その後は\n…って私、指名手配されてる！？\nちょ、た…助けてダーリン～！！", "2030/01/01 14:59:59", 2, 61, 10204);
INSERT INTO `v1_f0bd82009756089dccebff514cf79ccb3204c6be05623840a2eeb8016be27834` VALUES (-285.0, 2, 132402, 201, "イロハ", "2025/04/30 12:00:00", 0.0, 7.904, 1020402, "ルイちゃんのおばあちゃん優しくて\nいつもにこにこで、イロハ大好き♪\nでも一番好きなのは、角がすっごく\n大きくてかっこいいとこなんだ～♪", "2030/01/01 14:59:59", 1, 61, 10204);
INSERT INTO `v1_f0bd82009756089dccebff514cf79ccb3204c6be05623840a2eeb8016be27834` VALUES (-285.0, 2, 132502, 301, "ソノ", "2025/04/30 12:00:00", 0.0, 8.487, 1020403, "ノゾミちゃんのおかげで売上が安定\nしてきたのに、臨時休業、痛すぎる\n…ま、ルイちゃんのために\n一肌脱ぐか。行くよイロハ～", "2030/01/01 14:59:59", 4, 61, 10204);
